      "rule": "<p>智能搭配</p><p>1.招稿要求</p><p>达人要求： 入驻潮男养成频道，有独立产生专业的相关内容的能力，所有内容均为原创</p><p>①商品所在店铺DSR评分不低于4.6；</p><p>②须符合《营销活动规则》</p><p><br></p><p><br></p><p>2.图片要求：</p><p>*商品必须必须为白底图&nbsp;&nbsp;</p><p>*整个搭配图上必须无水印、无拼接、无logo、无多余文字，英文字母；禁用明星图和无版权图。</p><p>*搭配模特和场景必须完整。场景不完整，模特不完整，场景观感不适，场景调性不足审核均会不通过。</p><p>3.智能搭配发布教程视频版：</p><p>https://daren.alicdn.com/vOFiMqAVbMTlAtg0VWP/zRAAWezSKCwGsykAFmJ@@sd.mp4</p><p><span style=\"color: rgb(255, 0, 0);\">智能搭配模版须在以下2个模版中2选1。</span></p><p>模版1:左边模特场景，右边商品组合；模特场景：商品组合为1:1；如下图。</p><p><img src=\"https://img.alicdn.com/imgextra/i3/2312644075/TB21Ut_eDJ_SKJjSZPiXXb3LpXa_!!2-martrix_bbs.png\"></p><p>模版2:左边模特场景，右边商品组合；模特场景：商品组合为1:2；如下图。</p><p>左侧模特扣白底图，抠图质量要高，保证人物完整，没有任何毛边杂质。</p><p><img src=\"https://img.alicdn.com/imgextra/i1/2312644075/TB2P.Rcc6uhSKJjSspjXXci8VXa_!!2-martrix_bbs.png\"></p><p>模特错误案例：</p><p><img src=\"https://img.alicdn.com/imgextra/i4/2312644075/TB2oe9Eg3oQMeJjy0FnXXb8gFXa_!!2-martrix_bbs.png\"></p><p><img src=\"https://img.alicdn.com/imgextra/i4/2312644075/TB2uV5Eg3MPMeJjy1XbXXcwxVXa_!!2-martrix_bbs.png\"></p><p>商品错误案例</p><p><img src=\"https://img.alicdn.com/imgextra/i2/2312644075/TB2Ow8mdE1HTKJjSZFmXXXeYFXa_!!2-martrix_bbs.png\"></p><p><br></p><p><br></p><p><span style=\"color: rgb(255, 0, 0);\">帖子招稿要求</span></p><p><span style=\"color: rgb(0, 0, 0);\">1.封面图规范：</span></p><p><span style=\"color: rgb(0, 0, 0);\">封面图禁止使用白底图；无版权明星，影视剧图；广告图；禁止携带任何牛皮癣。比例不协调，场景不完整，压缩变形图同样审核不过。</span></p><p><span style=\"color: rgb(0, 0, 0);\">错误案例：</span></p><p><span style=\"color: rgb(255, 0, 0);\"><img src=\"https://img.alicdn.com/imgextra/i1/2312644075/TB2FzweiBcHL1JjSZJiXXcKcpXa_!!2-martrix_bbs.png\"></span></p><p><span style=\"color: rgb(255, 0, 0);\"><img src=\"https://img.alicdn.com/imgextra/i2/2312644075/TB2gfMEizoIL1JjSZFyXXbFBpXa_!!2-martrix_bbs.png\"></span></p><p><br></p><p><span style=\"color: rgb(255, 0, 0);\">正确案例：</span></p><p><img src=\"https://img.alicdn.com/imgextra/i1/2312644075/TB2rqgmcu38SeJjSZFPXXc_vFXa_!!2-martrix_bbs.png\"></p><p><br></p><p><img src=\"https://img.alicdn.com/imgextra/i4/2312644075/TB2sv63h5FTMKJjSZFAXXckJpXa_!!2-martrix_bbs.png\"></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">审核常见问题：https://daren.bbs.taobao.com/detail.html?postId=7772769</span></p><p><br></p><p>优秀案例分享：</p><p>1，商品图平铺，大小比例均衡（商品白底无叠加）</p><p>2，搭配排版整体，衣物从到到脚整齐排列（大小比例对比均衡）</p><p>3，搭配简单不重复（同类型衣服无重复推荐）</p><p><img src=\"https://img.alicdn.com/imgextra/i2/3048865566/TB2ItjIceALL1JjSZFjXXasqXXa_!!2-martrix_bbs.png\"><img src=\"https://img.alicdn.com/imgextra/i3/3048865566/TB2uOkOaSRRMKJjy0FlXXXFepXa_!!2-martrix_bbs.png\"><img src=\"https://img.alicdn.com/imgextra/i3/3048865566/TB2I6nVck.HL1JjSZFuXXX8dXXa_!!2-martrix_bbs.png\"><img src=\"https://img.alicdn.com/imgextra/i4/3048865566/TB23qj1a3oQMeJjy0FnXXb8gFXa_!!2-martrix_bbs.png\"></p>",
      "qualifyList": ["粉丝数大于等于0"],
