      "qualifyList": ["认证角色为：时尚媒体，时尚网站 APP，时尚自媒体，时尚编辑，时尚博主，时尚设计师，时尚买手，时尚搭配师，品牌主理人，情怀匠人，潮鞋达人，运动户外媒体，运动户外网站App，运动户外自媒体", "专注领域为型男", "达人等级为L2、L3、L4、L5或L6", "为商家账号"],
      "rule": "<p data-spm-anchor-id=\"0.0.0.i13.6e837d10Fdp1hZ\">hi 各位达人：</p><p>手淘改版，潮男养成定位为男性高端用户人群，将面向达人开始招稿，<strong>请达人在组织商品内容时，务必注意商品单价</strong>；</p><p>展现位置</p><p><img src=\"https://img.alicdn.com/imgextra/i3/856580923/TB259v.qR8kpuFjSspeXXc7IpXa_!!2-martrix_bbs.png\"></p><p>&nbsp;</p><p>一、&nbsp;潮男养成定位</p><p><br></p><p>基础定位：高端有品男装。关键词：搭配，杂志 风，时髦，格调&nbsp;</p><p>男性内容商品覆盖：男装/男士精品，男鞋，/男士内衣/家居服，美容护肤/美体/精油，服饰配件/皮带/帽子/围巾，运动/瑜伽/健身/球迷用品，男包</p><p>二、&nbsp;内容类型</p><p>1，什么是好的内容贴？</p><p>A，回归商品，用心整理时髦有调性商品帮助用户快速找到需要的东西或种草；</p><p>B，主题针对明确的用户需求场景；</p><p>C，帮助用户扫盲及介绍如何搭配，如何让自己生活更新潮</p><p>D， 选购分析的文案写到位，能真正对挑选商品起到帮助作用；</p><p>2，&nbsp;内容形式</p><p>a：图文贴</p><p>a， 介绍时髦，新鲜，格调好货，由主题，背景介绍，单品解读构成，视觉如下</p><p><img src=\"https://img.alicdn.com/imgextra/i2/856580923/TB2VJTiqH0kpuFjy0FjXXcBbVXa_!!2-martrix_bbs.png\">&nbsp;</p><p>三，招稿要求</p><p>a，达人要求： 潮男搭配师，美妆老师优先，有独立产生专业的相关内容的能力，所有内容均为原创</p><p>b，ifashion商品后台过滤门槛</p><p>①商品所在店铺DSR评分不低于4.6；</p><p>②淘宝店铺须符合《淘宝网营销活动规则》，天猫店铺符合《天猫营销活动基准规则》</p><p>6，勾选对应符合的分类标签，举例如下（待补充）</p><p>&nbsp;</p><p>B：图文贴</p><p>1，模板</p><p>为了让内容更有可阅读性，一定要有吸引人的主题，引人愿意读下去的主题介绍，详细的单品解读</p><p>2，不要滥用视觉元素，以下尽量避免</p><p><img src=\"https://img.alicdn.com/imgextra/i3/856580923/TB20anJqR4lpuFjy1zjXXcAKpXa_!!2-martrix_bbs.png\"></p><p>3，内容结构清晰，便于用户快速获取信息，尽量避免分类下再有分类等复杂结构的内容</p><p>4、图片比例规范：有的配图都必须是横图或者方图，即高度不高于宽度，可以是拼接图</p><p>5、封面图规范</p><p>达人后台在添加封面处上传：</p><p><img src=\"https://img.alicdn.com/imgextra/i4/856580923/TB2pU2sqMxlpuFjSszgXXcJdpXa_!!2-martrix_bbs.png\"></p><p>①banner会在必频道瀑布流透出，必须美观清晰、有调性，能明确传达清单内容信息，避免很宽泛抽象的banner；尽量选色调清新的图片；</p><p>② 请按照16:9比例制作清晰美观的图片，大小在700-900kb，审核通过后将进行裁剪，所以确保上下裁剪区域无重要元素，裁剪后图片完整美观。需要注意的是尽可能把重点放在图片中间。</p><p>&nbsp;</p><p>6，内容要求</p><p>&nbsp;<img src=\"https://img.alicdn.com/imgextra/i3/856580923/TB2AtaVn0hvOuFjSZFBXXcZgFXa_!!2-martrix_bbs.png\"></p><p>7，各字段要求</p><p>&nbsp;A，封面图，无任何文案、品牌logo、明星等信息；</p><p>&nbsp;B，文案&amp;配图</p><p>①总计全文文字不低于500个字，单段文字不超过150个字；</p><p>②文案要求可读性强，联系热点、教程、百科知识、行业趋势、品牌故事、历史背景等，为用户提供新知识；文风有特点，娱乐化、有梗，卖萌都行，希望能体现作者的生活态度（正文的第一句话会在频道瀑布流透出，请尽量引人入胜，点明主题）；</p><p>③多图片！多图片！多图片！用街拍图/氛围图/知识图等让内容的可读性更高；&nbsp;</p><p>C、商品要求</p><p>①商品数量≥6个，建议在6-15个之间；一个帖子必须包含3个店铺以上，每个店铺最多3个商品；</p><p>②匹配主题，突出精选感，让用户感知到商品是用心整理出来的，不能只是商品的堆砌；</p><p>③添加商品后，需要优化商品标题，优化至10个字之内，无类似关键词堆砌，无包邮、代购等无用信息，让用户一目了然推荐的是什么商品</p><p><img src=\"https://img.alicdn.com/imgextra/i1/856580923/TB25rG8aCvHfKJjSZFPXXbttpXa_!!2-martrix_bbs.png\">&nbsp;</p><p><br></p><p>④ 每篇内容的商品调性和目标人群需一致，内容是面向中端人群还是高端人群需要明确；</p><p>⑤单面向中高端用户，低端商品限制发布。</p><p>&nbsp;</p><p><br></p><p>D、 商品图片</p><p>要求正方形，无水印、无拼接、无logo、无多余文字，商品主题明显，不小于500X500；</p><p>F、分类&amp;标签</p><p>①所有内容再投稿时需要在“分类”中勾选符合的场景（只能选一个）</p><p>勾选对应符合的分类标签，只能在品类，人群，风格、材质、场景&amp;季节、热门话题、色彩等分类中里勾选自己合适的标签，只能勾选一个（全部只能1个），必须准确，不是越多越好，而是越准越好，这个牵涉到线上的场景投放，需要注意的是所有分类词即是一个场景，所以大家可以根据场景来投稿，如网红小粗跟，线上会有一个场景，里面会有很多关于粗跟鞋的内容贴，就是大家投放通过的内容，所以大家，可以每个场景都可以写内容</p><p>同时注意：乱沟，取消1个月投稿资格</p><p>&nbsp;</p><p>四，清退机制</p><p>每月一次排查，有符合以下清退条件的，将取消达人潮男内容发布权限：</p><p>1、不符合“潮男养成达人”入驻条件；</p><p>2、入驻期间不活跃，近30天内发布的图文/商品/搭配内容数量少于10篇（通过审核的）；</p><p>3、内容质量差，内容审核通过率低于50%；</p><p>4、入驻期间出现恶劣的抄袭行为；</p><p>5、入驻期间发布的内容有违法或者违规等行为。</p>",
