      "rule": "<p>一、基础要求：</p><p>围绕单品进行创作，面向高消费力、追求格调、追求品质的人群，对这款商品用有趣，专业，睿智等风格的文案进行描述，测评，介绍，挖掘这个商品的卖点。</p><p>&nbsp;</p><p>二、参与作者要求：</p><p>1.非在线卖家</p><p>2.大V层级≥创作达人（即创作达人或以上）</p><p>3.达人30天发布内容数≥30篇</p><p>4.认证达人申请通过时间≥90天</p><p>5.达人质量分≥500</p><p>6.达人指数分≥680</p><p>&nbsp;</p><p>三、内容类型</p><p>单品</p><p>&nbsp;</p><p>四、内容要求</p><p>1、商品基本调性：</p><p>（1）有腔调：商品本身有调性，如原创设计款、海淘口碑商品，有品质有逼格；</p><p>（2）有创意：本身有创意、较为新奇特，惊喜感较强；</p><p>（3）有口碑：商品在该领域有口碑，或者是当前人群领域部分意见领袖挖掘的小众好货。</p><p>以下类型商品不符合要求：</p><p>l&nbsp;&nbsp;商品与当前人群调性明显不符，或联系牵强；</p><p>l&nbsp;&nbsp;各大促销平台常见品牌及商品，即爆款；</p><p>l&nbsp;&nbsp;线下热门品牌及款式；</p><p>l&nbsp;&nbsp;高仿商品，商品外观、名称与大牌类似或雷同，既所谓的明星同款、大牌仿款，山寨货等；</p><p>l&nbsp;&nbsp;假货商品；</p><p>l&nbsp;&nbsp;普通红人款商品；</p><p>l&nbsp;&nbsp;价格低廉，外观粗糙，品质感差的商品。</p><p>2、图片要求：</p><p>尺寸：正方形，尺寸不小于500*500，最佳尺寸1080*1080；</p><p>基本规范：</p><p>（1）图片所示商品必须和标题、推荐理由，及宝贝详情页上的商品完全一致；白底图、场景图均可，主体突出、构图完整饱满，清晰度高，背景干净；商品第一张图务必美观干净，无logo无牛皮癣，商品主体突出，且水平居中放置、完整呈现商品，白底图优先；</p><p>（2）图片上必须无水印、无拼接、无logo、无多余文字；</p><p>（3）一张图片只能展示一个主体（组合套装类商品除外），多种颜色商品，只能选一个颜色展示；</p><p>（4）服饰类商品只能展示1个模特（情侣装和亲子装除外），慎用全身照；</p><p>（5）请选择最能体现商品特点、功能的视角，让用户能一眼看出商品信息。</p><p>&nbsp;</p><p>五、内容样例：</p><p>作品链接：<a href=\"https://daren.bbs.taobao.com/detail.html?&amp;postId=7895484\" target=\"_blank\">https://daren.bbs.taobao.com/detail.html?&amp;postId=7895484</a></p><p>&nbsp;</p><p>六、其他说明：</p><p>1、内容审核流程：机器审核</p><p>2、作者旺旺交流群：1561521223</p>",
