      "desc": "<p><span style=\"color: rgb(51, 51, 51);\">极有家，致力于帮助年轻人造有品位的家。严选物美质优的商品，提供专业的服务，帮助消费者发现搭配灵感和生活窍门。我们需要热爱生活，对家有自己独特的时尚见解，愿意分享的人。所需内容类型：搭配、帖子、清单等</span></p>",
